import React, { Component } from 'react';
import footer from './../../img/Footer.png';
import '../../App.css';

class AdOne extends Component {
  render() {
    return (

      <div className="App">
          <img src={footer} className="header" alt="header" />
      </div>
    );
  }
}

export default AdOne;
